    true,nt"url": null,nt"notes": "The Totalization Data Exchange (TDEX) process
    is an exchange between SSA and its foreign country partners to identify deaths of
    beneficiaries residing abroad. The process provides for the sharing of death data
    and restricts the disclosure of Personally Identifiable Information (PII).When TDEX
    was implemented in 2009 (TDEX II), it was comprised of two separate, distinct processes:
    one process provided death information to the Totalization (TOT) partners other
    process received death information from partner countries for use within SSA in
    2011, enhancements were made to create a finder file process in which SSA sends
    information to our foreign partners concerning beneficiaries residing in their country.
    The foreign partners respond with death information for US beneficiaries who have
    died in their country.",nt"license_title": "Other License Specified",nt"extras":
